import React from 'react';
import ChatList from "../components/chatList";
import Chat from "../components/chat";

const Chats = () => {
  return (
    <article className="w-full h-screen flex justify-center items-center md:p-10 md:pt-[50px] p-5">
      <ChatList />
      <Chat />
    </article>
  );
};

export default Chats;
